import React from 'react';


export default function Main(props){

    return(
        <>
        <div className="main-file" style={{
            width:"300px",
            height:"250px",
            border:"1px solid lightgray",
            display:"flex",
            flexDirection:"column",
            justifyContent:"center",
            alignItems:"center",
            borderRadius:"10px",
        }}>

            <h2>{props.text}</h2>
            <img src={props.image} alt="" style={{
                width:"80%",
                height:"80%"
            }}/>
        </div>
        </>
    )
}
